        internal bool IsDefense()
        {
            return purposes.Contains(BasePurpose.Defense);
        }
        internal bool IsMissingBlocks() {
            var found = RawTechExporter.SearchAndLoadEnemyTech(techName);
            if (found == null)
                return true;
            if (found.Blueprint.NullOrEmpty())
                return true;
            return !TempManager.ValidateBlocksInTechStrict(ref found.Blueprint);
        }
    }
